  [],\n\t\"revision_timestamp\": \"2015-05-06T21:25:40.558417\",\n\t\"name\": \"sputter-resistant-materials-for-electric-propulsion-project-5f7e5\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"This SBIR Phase 2 project shall develop
  sputter-resistant materials fornuse in electric propulsion test facilities and for
  plume shields onnspacecraft using electric thrusters.  A critical need arises becausenNASA
  is developing higher impulse, higher power thrusters for deep spacenscience missions.
  \ Such thrusters will erode chamber walls ten-timesnmore aggressively than before
  and create unacceptably high levels ofncontamination in the life test facilities.
  Without new materials thatnare ten-times more resistant than graphite, the only
  alternative may beninstallation of larger vacuum test chambers at huge facility
  cost.   Thenproposed sputter-resistant materials are based on carbon fibers in anhighly
  textured configuration that allows deep penetration of incidentnions and trapping
  of sputtered secondary atoms.  Phase 1 testing hasndemonstrated a 5x reduction in
  sputter backflow toward the ion source,nconsistent with modeling predictions. It
  appears feasible to extend thenuse of existing test facilities at least into planned
  near term testingnof next generation ion engines.   Phase 2 will develop thickernlow-contamination
  chamber liners intended for long duration exposure,nand modeling tools will be developed
  to aid in the design of bafflednchamber liners. Lightweight rigid plume shields
  for spacecraft using EPnwill be demonstrated and offered for testing. Removable,
  cleanable,nliner configurations will be demonstrated for use  with condensablenliquid
  metal propellants. Sputter testing will be performed by CSU usingnhemispherical
  witness plates to rapidly acquire directional yield data.nLow-contamination chamber
  liner materials designed for use in testingnhigh current, high voltage ion sources
  will be delivered under thencontract for evaluation by NASA.\",\n\t\"license_title\":
